const initColumns = [
  {
    title: "To-do",
    items: [
      {
        id: 1,
        content: "Hi! Im a task. You can try dragging me to the other sections. When you're done with me, drag me into the trash in the top right."
      },
      {
        id: 2,
        content: "Press the add button to create a new task. When you're done typing, press enter to add it to your to-do list."
      },
    ]
  },
  {
    title: "Doing",
    items: [
      {
        id: 3,
        content: 'Add capability to add a card in a lane'
      },
      {
        id: 4,
        content: 'Add capability to add a card in a lane 2'
      },
    ]
  },
  {
    title: "Done",
    items: [
      {
        id: 5,
        content: 'Add capability to add a card in a lane'
      },
      {
        id: 6,
        content: 'Add capability to add a card in a lane 2'
      },
    ]
  },
];

export default initColumns;
